// import Slider from '../components/Slider';
import './Home.css';
const Discount = lazy(() => import('../components/Discount'))
const NewArrivle = lazy(() => import('../components/NewArrivle'))
const ProductList = lazy(() => import('../components/ProductList'))
const Slider = lazy(() => import('../components/Slider'))

const Home: React.FC = () => {
  return (
    <IonPage>
      {/* <IonHeader>
        <IonToolbar>
          <IonTitle>Blank</IonTitle>
        </IonToolbar>
      </IonHeader> */}
      <IonContent  >
     <div className='d-flex align-items-center'><Slider  /></div>
      <h3>New Arrivles</h3>
      <NewArrivle />
      <h3>Discount</h3>
      <Discount />
      <h3>All Product</h3>
        <ProductList />
      </IonContent>
    </IonPage>
  );
};

export default Home;
